CREATE TYPE notification_type AS ENUM (
  -- 'friend_request_sent',
  -- 'friend_request_accepted'
  'intro_like',
  'matched',
  'view'
);

CREATE TYPE amount AS ENUM (
  'regularly',
  'sometimes',
  'never'
);

CREATE TYPE body_type AS ENUM (
  'fit',
  'curvy',
  'average',
  'skinny'
);

CREATE TYPE children_status_type AS ENUM (
  'has',
  'does_not_have'
);

CREATE TYPE pet_status_type AS ENUM (
  'cat',
  'dog',
  'other',
  'none'
);

