CREATE TABLE countries (
  id UUID PRIMARY KEY,
  name VARCHAR(255) NOT NULL,
  created_at BIGINT NOT NULL
);

CREATE TABLE cities (
  id UUID PRIMARY KEY,
  name VARCHAR(255) NOT NULL,
  country_id UUID NOT NULL REFERENCES countries(id),
  created_at BIGINT NOT NULL
);

CREATE TABLE users (
  id UUID PRIMARY KEY,
  name VARCHAR(255) NOT NULL,
  email VARCHAR(255) UNIQUE NOT NULL,
  -- username VARCHAR(255),
  title VARCHAR(70),
  description VARCHAR(255),
  ideal_match VARCHAR(255),
  birthday DATE,
  age INTEGER,
  gender gender,
  interested_in gender,
  height INTEGER,
  smoking amount,
  drinking amount,
  body body_type,
  children_status children_status_type,
  pet_status pet_status_type,
  -- relationship_status relationship_status_type,
  city_id UUID REFERENCES cities(id),
  password VARCHAR(255),
  user_status user_status_type NOT NULL,
  profile_image_id UUID REFERENCES media_metadatas(id),
  -- friends_count INTEGER,
  verified BOOLEAN NOT NULL,
  last_login_at BIGINT,
  created_at BIGINT NOT NULL
);

CREATE TABLE onboarding (
  user_id UUID REFERENCES users(id),
  step INTEGER NOT NULL,
  completed_at BIGINT,
  created_at BIGINT NOT NULL
);

CREATE TABLE user_images (
  -- id UUID PRIMARY KEY,
  user_id UUID REFERENCES users(id),
  image_id UUID NOT NULL REFERENCES media_metadatas(id),
  position INTEGER NOT NULL,
  created_at BIGINT NOT NULL
);

CREATE TABLE session_tokens (
  token VARCHAR(255) PRIMARY KEY,
  user_id UUID NOT NULL REFERENCES users(id),
  remember BOOLEAN NOT NULL,
  created_at BIGINT NOT NULL
);

CREATE TABLE communities (
  id UUID PRIMARY KEY,
  name VARCHAR(255) NOT NULL,
  created_at BIGINT NOT NULL
);

CREATE TABLE chats (
  id UUID PRIMARY KEY,
  -- community_id UUID REFERENCES communities(id),
  last_message_at BIGINT,
  created_at BIGINT NOT NULL
);

CREATE TABLE chat_members (
  chat_id UUID REFERENCES chats(id),
  user_id UUID NOT NULL REFERENCES users(id),
  not_seen_count INTEGER NOT NULL,
  created_at BIGINT NOT NULL
);

CREATE TABLE chat_messages (
  id UUID PRIMARY KEY,
  chat_id UUID REFERENCES chats(id),
  user_id UUID NOT NULL REFERENCES users(id),
  text TEXT NOT NULL,
  created_at BIGINT NOT NULL
);

